import React from 'react';
import './UploadId.css';
import FeatureImage from '../assets/new-aman-child.png'; // Replace with the correct path

const Upload = () => {
  return (
    <div className="upload-container">
      <h1 className="upload-heading">Student Upload College ID For Free Access</h1>
      <form className="upload-form" action="/upload" method="post" encType="multipart/form-data">
        <div className="upload-file-container">
          <input type="file" name="file" className="file-input" />
          <input type="submit" value="Upload" className="upload-button" />
        </div>
      </form>
      <div className="feature-image-container">
        <img src={FeatureImage} alt="Feature" className="feature-image" />
      </div>
    </div>
  );
};

export default Upload;
